INSERT INTO `adminnotification_inbox` VALUES (1,4,'2019-06-10 23:59:43','Deprecation Notice','Catalog Search is currently configured to use the MySQL engine, which has been deprecated. Consider migrating to one of\nthe Elasticsearch engines now to ensure there are no service interruptions during your next upgrade.','',0,0,0,NULL,NULL),(2,3,'2019-06-12 13:11:35','New version 2.8.10 of Magefan Magento 2 Blog Extension is now available.',' You can download the new version from Magefan Store or update it via composer. Get us in touch if you need our help with an update or you have any questions.\n                                https://magefan.com/magento2-blog-extension?version=2.8.10\n                             ','https://magefan.com/magento2-blog-extension?version=2.8.10',0,0,0,NULL,NULL),(3,4,'2019-06-12 13:11:35','FAQ: How to configure &quot;read more&quot; in your Magento 2 blog post',' If you still don\'t know how to configure read more functionality in your magento 2 blog post, please read this article.\n                Online documentation for Magento 2 blog extension is also available on our website. http://goo.gl/XOEdpy ','http://magefan.com/blog/add-read-more-tag-to-blog-post-content/?from=notification1',0,0,0,NULL,NULL),(4,4,'2019-06-13 18:29:36','How low can your commerce Total Cost of Ownership go?‚ÄØ ','Magento provides‚ÄØmultiple eCommerce offerings with unique benefits. The question becomes: Is your free version of Magento Open Source the best option for your business and budget? Properly evaluate the all-in costs of software, development, upkeep and support needs with this free guide: http://bit.ly/2XMWGLw','http://bit.ly/2XMWGLw',0,0,0,NULL,NULL),(5,1,'2019-06-25 16:09:17','Important Security and Performance Updates Released in Magento 2.3.2','The latest releases of Magento include important security enhancements along with performance and productivity improvements. We strongly recommend that you upgrade to ensure your sites maintain the highest level of security. You can review the release notes for more information about all of the enhancements and information on security updates included in these versions of Magento at our Security Center: https://magento.com/security/','https://devdocs.magento.com/guides/v2.3/release-notes/bk-release-notes.html',0,0,0,NULL,NULL),(6,1,'2019-06-28 06:00:00','Psst..Stack Framework Bundle - Professional Package ONLY NOW at special price! $300 discount ','A Bundle Pack of 25+ Premium Magento extensions to get you started with any Magento 2 project.','https://www.weltpixel.com/stack-magento-framework-extension-pack?utm_source=Admin&amp;utm_medium=Notifications&amp;utm_campaign=StackDiscount',0,0,0,NULL,NULL),(7,4,'2019-07-16 15:39:08','Webinar: Power Your Marketing in Magento with Google Shopping ads Channel','Join us on Wednesday, July 31, 2019 to discover how to reach more customers and improve ROI while simplifying your Google advertising operations ‚Äì all from the Magento admin ‚Äì with Google Shopping ads Channel. During this 45-minute webinar you‚Äôll learn how you can seamlessly connect your Magento store with Google Merchant Center (GMC) and Google Ads, sync your product catalog and inventory with GMC so you never have to worry about advertising out-of-stock products or inaccurate pricing, and get the most out of your Smart Shopping campaigns with our campaign‚Äôs best practices. Two convenient webinar times ‚Äì 8:00am PDT and 5:00pm PDT. Register today!','https://magento.com/resources/power-your-marketing-in-magento-google-shopping-ads-channel',0,0,0,NULL,NULL),(8,1,'2019-07-23 06:00:00','Important WeltPixel Product Updates - July 2019. Performance Improvements.','This month, we\'ve continued improving and optimizing our products based on user feedback and suggestions. We\'ve also released a new Speed Optimization &amp; Advanced JS Bundling extension that is included in all Pearl Theme packs for free. You can download the latest release from your weltpixel.com account